import React from 'react'
import { makeStyles } from '@material-ui/core/styles'
import Paper from '@material-ui/core/Paper'
import Typography from '@material-ui/core/Typography'
import TextField from '@material-ui/core/TextField'
import Divider from '@material-ui/core/Divider'
import Button from '@material-ui/core/Button'

import styles from './Login.module.css'

const useStyles = makeStyles(theme => ({
  root: {
    '& > *': {
      width: 200,
    },
  },
}));


export default () => {
  const classes = useStyles();
  return <div className={styles.content}>
    <Paper elevation={3} className={styles.paper}>
      <Typography align='center' variant='h2' gutterBottom={true}>
        Login
      </Typography>
      <Divider />
      <div className={classes.form}>
        <TextField id="username" label="Username" margin='normal'/>
        {/* <TextField id="password" label="Password" variant="outlined" margin='normal'/> */}
        <Button color='primary' size='large' variant='contained'>LogIn</Button>
      </div>
    </Paper>
  </div>
}
